json.viewLogic:
view: activity_logs {
  sql_table_name:
        {% if _user_attributes['looker_env'] == 'dev' %}
          {{ _user_attributes['dev_database_prefix'] }}analytics.{{ _user_attributes['dev_schema_prefix'] }}staging_app.stg_app__activity_logs
        {% elsif _user_attributes['looker_env'] == 'prod' %}
          analytics.staging_app.stg_app__activity_logs
        {% else %}
          analytics.staging_app.stg_app__activity_logs
        {% endif %}
        ;;

  dimension: generated_message_id {
    group_label: "IDs"
    primary_key: yes
    type: number
    sql: ${TABLE}."GENERATED_MESSAGE_ID" ;;
  }
}

view: employee_total_income {
  sql_table_name: ${employee_income_source.SQL_TABLE_NAME} ;;

  dimension: id {
    type: number
    sql: ${TABLE}.id;;
  }

  dimension: name {
    type: string
    sql: ${TABLE}.name;;
  }

  measure: total_income {
    type: sum
    sql: ${TABLE}.income;;
  }
}

view: employee_tax_report {
  sql_table_name: data-warehouse.finance.form-16;;

  dimension: id {
    type: number
    sql: ${TABLE}.id;;
  }

  dimension: name {
    type: string
    sql: ${TABLE}.name;;
  }

  measure: taxable_income {
    type: sum
    sql: ${TABLE}.tax;;
  }
}

SELECT
      employee_id,
      employee_name,
      {% if dw_eff_dt_date._is_selected or finance_dw_eff_dt_date._is_selected %}
        prod_core.data.r_metric_summary_v2
      {% elsif dw_eff_dt_week._is_selected or finance_dw_eff_dt_week._is_selected %}
        prod_core.data.r_metric_summary_v3
      {% else %}
        'default_table' as source
      {% endif %},
      employee_income
    FROM source_table
    WHERE
        {% condition source_region %} source_table.region {% endcondition %} AND
        {% if rating_window._is_filtered %}
            {% condition rating_window %} DATE (rating_created) {% endcondition %}
        {% endif %}

view: environment_activity_logs {
  sql_table_name:  -- if prod -- prod.staging_app.stg_app__activity_logs
                   -- if dev -- {{ _user_attributes['dev_database_prefix'] }}analytics.{{ _user_attributes['dev_schema_prefix'] }}staging_app.stg_app__activity_logs
                   ;;

  dimension: generated_message_id {
    group_label: "IDs"
    primary_key: yes
    type: number
    sql: ${TABLE}."GENERATED_MESSAGE_ID" ;;
  }
}

view: rent_as_employee_income_source {
  sql_table_name: (
         SELECT id,
                name,
                source
         FROM ${employee_income_source.SQL_TABLE_NAME}
         WHERE source = "RENT"
         ORDER BY source desc
         LIMIT 10
  );;


  dimension: id {
    type: number
    sql: ${TABLE}.id ;;
  }

  dimension: name {
    type: string
    sql: ${TABLE}.name ;;
  }

  dimension: source {
    type: string
    sql: ${TABLE}.source ;;
  }
}

view: parent_view {
  sql_table_name: `dataset.table` ;;

  dimension: id {
    primary_key: yes
    type: string
    sql: ${TABLE}.id ;;
  }

  dimension: parent_dimension_1 {
    type: string
    sql: ${TABLE}.parent_dimension_1 ;;
  }

  measure: parent_count {
    type: count
  }
}

include: "parent_view.view.lkml"

view: child_view {
  extends: [parent_view]

  dimension: id {
    primary_key: yes
    type: integer
    sql: ${TABLE}.id ;;
  }

  dimension: child_dimension_1 {
    type: string
    sql: ${TABLE}.child_dimension_1 ;;
  }
}
